function getPieces(fen){
    let someBoard = new Chess(fen);
    let pieces = [];
    let x = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h'];
    let y = ['1', '2', '3', '4', '5', '6', '7', '8'];

    for(let i = 0; i < y.length; i++){
        for(let j = 0; j < x.length; j++){
            let square = x[j] + y[i];
            let piece = someBoard.get(square);
            if(piece != null){
                pieces.push({
                    piece: piece,
                    square: square,
                })
            }
        }
    }

    return pieces;
}

function getMarkupForPiece(square, piece){
    let x_shift = square.charCodeAt(0) - 96 - 1;
    let y_shift = parseInt(square[1]) - 1;

    let a1_x_center = 1.13;
    let a1_y_center = 285.65;

    let new_x_center = a1_x_center + x_shift * 47.61;
    let new_y_center = a1_y_center - (y_shift-1) * 47.61;

    return `<use transform="translate(${new_x_center} ${new_y_center}) scale(0.32 0.32)" xlink:href="#${piece.color + piece.type}"/>`;

}

function drawSquares(squares){
    for(let i = 0; i < squares.length; i++){
        drawSquare(squares[i]);
    }
}

function drawSquare(square){
    let x_shift = square.charCodeAt(0) - 96 - 1;
    let y_shift = parseInt(square[1]) - 1;

    let a1_x_center = 2;
    let a1_y_center = 287.65;

    let new_x_center = a1_x_center + x_shift * 47.61;
    let new_y_center = a1_y_center - (y_shift-1) * 47.61;

    let squareHtml = `<rect xmlns="http://www.w3.org/2000/svg" x="${new_x_center}" y="${new_y_center}" width="48" height="47" rx="9.88" ry="9.88" fill="none" stroke="red" stroke-linecap="round" stroke-linejoin="round" stroke-width="5"/>`;

    let el = document.getElementById("second-layer");
    el.insertAdjacentHTML('beforeend', squareHtml);
}

function drawArrow(startingSquare, endingSquare){
    let a1_x_center = 26.5;
    let a1_y_center = 360;

    let X_SHIFT_RIGHT = 47;
    let Y_SHIFT_UP = 47;

    let startingSquareXShift = startingSquare.charCodeAt(0) - 96 - 1;
    let startingSquareYShift = parseInt(startingSquare[1]) - 1;

    let newStartingXSquare = a1_x_center + startingSquareXShift * X_SHIFT_RIGHT;
    let newStartingYSquare = a1_y_center - (startingSquareYShift) * Y_SHIFT_UP;

    let endSquareXShift = endingSquare.charCodeAt(0) - 96 - 1;
    let endSquareYShift = parseInt(endingSquare[1]) - 1;


    let endStartingXSquare = a1_x_center + endSquareXShift * X_SHIFT_RIGHT;
    let endStartingYSquare = a1_y_center - (endSquareYShift) * Y_SHIFT_UP;

    // x1 = 25, y1 = 360; x2 = 75, y2 = 310
    let arrowHtml = `<line x1="${newStartingXSquare}" y1="${newStartingYSquare}" x2="${endStartingXSquare}" y2="${endStartingYSquare}" stroke="red" stroke-width="4" marker-end="url(#arrowhead)" />`;
    let el = document.getElementById("second-layer");
    el.insertAdjacentHTML('beforeend', arrowHtml);
}

function drawPieces(fen){
    let pieces = getPieces(fen);
    let html = "";
    for(let i = 0; i < pieces.length; i++){
        let piece = pieces[i].piece;
        let square = pieces[i].square;
        html += getMarkupForPiece(square, piece);
    }
    html += '<rect x="1" y="1" width="381" height="381" fill="none" stroke="#000" stroke-miterlimit="10" stroke-width="2"/>';
    let el = document.getElementById("second-layer");
    el.innerHTML = html;
}

function drawArrows(arrows){
    for(var i = 0; i < arrows.length; i++){
        let arrow = arrows[i];
        let startingPoint = arrow[0];
        let endingPoint = arrow[1];
        drawArrow(startingPoint, endingPoint);
    }
}

/**
 * Usage:
 * drawEmptyBoard("foo", "rn1q1rk1/pbp1bppp/1p1p1n2/6B1/2BNP3/2N2P2/PPPQ2PP/2KR3R w Kq - 0 1", ["a1", "b2", "d8"], [["a2", "h2"], ["b1", "h7"]]);
 * @param divId
 * @param fen
 * @param squares
 * @param arrows
 */
function drawBoardDiagram(divId, fen, squares, arrows){
    drawEmptyBoard(divId);
    drawPieces(fen + " w KQkq - 0 1");
    drawSquares(squares);
    drawArrows(arrows);

    console.log(document.getElementById(divId).innerHTML);

    return document.getElementById(divId).innerHTML;
}

drawBoardDiagram(window.divId, window.currentFen, window.circles, window.arrows);